import{_ as c,c as r,o as a,a2 as i,j as t}from"./chunks/framework.4_bZ6nyl.js";const k=JSON.parse('{"title":"2018.04.28 @台南知事官邸 [假日騎士日誌]","description":"","frontmatter":{"title":"2018.04.28 @台南知事官邸 [假日騎士日誌]","date":"2018-04-28T09:32:35.000Z","categories":["假日騎士日誌"]},"headers":[],"relativePath":"Bike/BikeTravel/20180428_台南知事官邸.md","filePath":"Bike/BikeTravel/20180428_台南知事官邸.md"}'),s={name:"Bike/BikeTravel/20180428_台南知事官邸.md"},e=i('<p><a href="https://www.strava.com/activities/1540163110" target="_blank"><img src="https://farm1.staticflickr.com/909/39984288260_aea41d7476.jpg"></a><br> 最近追花追到有點膩了，這次改追古蹟<br> 知事官邸以前有來過一次，地點位於市區</p><p>因為周末一大早出門，所以可以避開車潮<br> 早上到的時候，都沒人可以獨自好好拍照</p><p><img src="https://farm1.staticflickr.com/970/27923067978_695297d4f7.jpg" alt=""><br><img src="https://farm1.staticflickr.com/960/41749532592_03df9bbee3.jpg" alt=""><br><img src="https://farm1.staticflickr.com/960/41074575354_60601c6785.jpg" alt=""></p><p>看到旁邊告示牌介紹，以前的建築物是有鐘樓<br> 後來被美軍轟炸後，無法修復以前的樣貌<br> 但有一個時鐘的雕飾，可以從側45度角拍照合成<br> 雖然當天是陰天，但還是有點背光，背起來偏亮</p><p><img src="https://farm1.staticflickr.com/944/40892356835_d1ef5154d4.jpg" alt=""><br><img src="https://farm1.staticflickr.com/947/41074566104_aa9b0ab720.jpg" alt=""></p><p>另外看到一旁的解說，紅磚砌成的拱廊是閩南特色<br> 台灣有些古蹟常會融合當地建材形成在地的特色<br><img src="https://farm1.staticflickr.com/963/41749533082_5b022eaa63.jpg" alt=""><br><img src="https://farm1.staticflickr.com/961/40892353785_2719c0bcaf.jpg" alt=""><br><img src="https://farm1.staticflickr.com/969/39984016200_b5c45d164e.jpg" alt=""><br><img src="https://farm1.staticflickr.com/912/39984017360_533ed2436c.jpg" alt=""><br><img src="https://farm1.staticflickr.com/943/39984019450_412edf57ec.jpg" alt=""></p><p>旁邊有幾台武車(阿公的腳踏車)，排起來很有味道<br><img src="https://farm1.staticflickr.com/823/41074589124_fe73927bf2.jpg" alt=""><br><img src="https://farm1.staticflickr.com/963/26923126507_aa1554c4cd.jpg" alt=""><br><img src="https://farm1.staticflickr.com/864/41749516712_530ae700bc.jpg" alt=""><br><img src="https://farm1.staticflickr.com/956/41074593104_321d5944db.jpg" alt=""><br><img src="https://farm1.staticflickr.com/956/40892371535_4225ce6cc0.jpg" alt=""><br><img src="https://farm1.staticflickr.com/826/40892374385_252cfd4848.jpg" alt=""></p><p>回程就去海岸，本來想拍碧藍色的海水<br> 但陰天，整片看過去都是灰灰的<br> 可能要出太陽，才能拍出有藍色的海洋<br> 經過興達港時，覺得當地空氣品質不佳<br> 可能那邊有一個火力發電機的關係，就趕緊離開</p><p>回程路上，旁邊是魚塭，不知道甚麼樹，吸引我的注意<br> 葉子有多種顏色(綠色、褐色、紅色)<br> 樹枝也很茂密，感覺像是常見的路樹</p><p><img src="https://farm1.staticflickr.com/977/41749521082_16888762c4.jpg" alt=""><br><img src="https://farm1.staticflickr.com/864/39984032090_75109a1a10.jpg" alt=""><br><img src="https://farm1.staticflickr.com/968/40892376955_88fa416e9d.jpg" alt=""><br><img src="https://farm1.staticflickr.com/962/26923136457_ca269efb62.jpg" alt=""><br><img src="https://farm1.staticflickr.com/911/41749520552_e4d9528fa6.jpg" alt=""><br><img src="https://farm1.staticflickr.com/829/40892351465_91ce603d36.jpg" alt=""><br><img src="https://farm1.staticflickr.com/864/40892350715_73b2009777.jpg" alt=""><br><img src="https://farm1.staticflickr.com/965/27923055768_b96a7a59f5.jpg" alt=""></p>',10),m=t("div",{class:"embedly-responsive",style:{position:"relative","padding-bottom":"78.2227%",height:"0",overflow:"hidden"}},[t("iframe",{class:"embedly-embed",frameborder:"0",scrolling:"no",allowfullscreen:"",src:"https://cdn.embedly.com/widgets/media.html?src=https://www.relive.cc/view/vwq1ZZjxLvA/widget?r=embed-site&url=https://www.relive.cc/view/vwq1ZZjxLvA?r=embed-site&image=https://www.relive.cc/view/vwq1ZZjxLvA/png?x-ref=embed-site&key=f1631a41cb254ca5b035dc5747a5bd75&type=text/html&schema=relive",width:"1024",height:"801",style:{position:"absolute",top:"0",left:"0",width:"100%",height:"100%"}})],-1),p=[e,m];function l(f,o,_,g,b,d){return a(),r("div",null,p)}const n=c(s,[["render",l]]);export{k as __pageData,n as default};
